import React from "react";
import LOGO from "../Image/Logo_IM_1.png";
import HeaderSocial from "./HeaderSocial";

export const Header = () => {
  return (
    <header>
      <div className="container header__container"></div>
      <h5>Hello I'm</h5>
      <h1> Itamar Miron</h1>
      <h5 className="text-light"> Music Producer</h5>
      <HeaderSocial />

      <div className="logo">
        <img src={LOGO} alt="logo" />
      </div>

      <a href="#contact" className="scroll__down">
        Scroll Down
      </a>
    </header>
  );
};
